column8:
シュンソク 瞬足 定番スクール！ホワイト＆ブラック JJ184・JJ188


シュンソクスクールスニーカー！真っ白なオールホワイトデザイン！真っ黒なオールブラック！ホワイトは通学から室内の指定靴に選ばれております。黒はフォーマルにも人気のデザイン！定番デザインで男子・女子にも人気なスニーカーです。軽量ソール、カップインソール搭載。

＝半額送料のご案内＝
・半額送料245円に訂正したメールを改めて当社よりご連絡いたします。
・半額送料は沖縄県・離島のお客様には適用になりませんのでご了承くださいませ。 

《フィッティング感覚》　靴幅2E。標準のサイズです。
【素　材】 　合皮/ポリエステル　　ソール：ＥＶＡ＋ラバー
【重　量】　 170ｇ　(21cm片足)

<BR><BR>
